#
# Structure for table "user"
#

CREATE TABLE `user` (
  `id_user` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID do Usuário',
  `user` varchar(30) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Usuário',
  `password` varchar(256) COLLATE utf8_unicode_ci DEFAULT '' COMMENT 'Senha',
  `name` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Nome',
  `email` varchar(256) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT 'E-mail',
  `institution` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Instituição/Empresa de atuação',
  `function` tinyint(2) DEFAULT NULL COMMENT 'Função Nepo',
  `ramal` smallint(5) DEFAULT NULL COMMENT 'Ramal',
  `date_ts` datetime DEFAULT NULL COMMENT 'Data de Cadastro',
  `extra_information` mediumtext COLLATE utf8_unicode_ci COMMENT 'Informaçoes Extras',
  `user_active` tinyint(1) DEFAULT NULL COMMENT 'Usuario Ativado/Desativado',
  `sendMailException` int(1) DEFAULT NULL COMMENT 'Notificação por Email',
  `key` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Chave de Validação',
  `organizer` binary(1) DEFAULT '0' COMMENT 'Organizador',
  `signature` varchar(256) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Caminho da Imagem da Assinatura',
  PRIMARY KEY (`id_user`),
  UNIQUE KEY `user` (`user`,`email`),
  FULLTEXT KEY `user_2` (`user`)
) ENGINE=MyISAM AUTO_INCREMENT=532 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Usuário do Sistema de Certificados';

