#
# Structure for table "user_teste"
#

CREATE TABLE `user_teste` (
  `id_user` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID do Usuário',
  `user` varchar(30) NOT NULL COMMENT 'Usuário',
  `password` varchar(256) DEFAULT '' COMMENT 'Senha',
  `name` varchar(50) NOT NULL COMMENT 'Nome',
  `email` varchar(256) NOT NULL DEFAULT '' COMMENT 'E-mail',
  `institution` varchar(50) NOT NULL COMMENT 'Instituição/Empresa de atuação',
  `function` tinyint(2) DEFAULT NULL COMMENT 'Função Nepo',
  `ramal` tinyint(4) DEFAULT NULL COMMENT 'Ramal',
  `date_ts` datetime DEFAULT NULL COMMENT 'Data de Cadastro',
  `extra_information` text COMMENT 'Informaçoes Extras',
  `user_active` tinyint(1) DEFAULT NULL COMMENT 'Usuario Ativado/Desativado',
  `sendMailException` int(1) DEFAULT NULL,
  `key` varchar(255) DEFAULT NULL COMMENT 'Chave de Validação',
  PRIMARY KEY (`id_user`),
  UNIQUE KEY `user` (`user`,`email`),
  FULLTEXT KEY `user_2` (`user`)
) ENGINE=MyISAM AUTO_INCREMENT=188 DEFAULT CHARSET=latin1 ROW_FORMAT=DYNAMIC COMMENT='Usuário do Sistema de Certificados';

